contracts/facets/QuallaSubscriptionFacet.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/GSN/Context.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

import "../interfaces/IERC165.sol";
import "../interfaces/IERC1155.sol";
import "../libraries/LibSubscriptions.sol";
import "../libraries/LibUsers.sol";
import "../libraries/LibDiamond.sol";
import "../libraries/LibERC1155.sol";

contract QuallaSubscriptionsFacet is Context, IERC1155 {
    using SafeMath for uint256;

    /***********************************|
   |             Read Functions         |
   |__________________________________*/

    /**
     * @dev Returns the amount of tokens of token type `id` owned by `account`.
     *
     * Requirements:
     *
     * - `account` cannot be the zero address.
     */
    function balanceOf(address account, uint256 id)
        external
        view
        override
        returns (uint256)
    {
        LibSubscriptions.SubscriptionStorage storage ss =
            LibSubscriptions.subscriptionStorage();
        return ss._balances[id][account];
    }

    function balanceOfBatch(address[] calldata accounts, uint256[] calldata ids)
        external
        view
        override
        returns (uint256[] memory)
    {
        require(
            accounts.length == ids.length,
            "ERC1155: accounts and ids length mismatch"
        );
        LibSubscriptions.SubscriptionStorage storage ss =
            LibSubscriptions.subscriptionStorage();

        uint256[] memory batchBalances = new uint256[](accounts.length);

        for (uint256 i = 0; i < accounts.length; ++i) {
            require(
                accounts[i] != address(0),
                "ERC1155: batch balance query for the zero address"
            );
            batchBalances[i] = ss._balances[ids[i]][accounts[i]];
        }

        return batchBalances;
    }

    /***********************************|
   |             Write Functions        |
   |__________________________________*/

    function setApprovalForAll(address operator, bool approved)
        external
        override
    {
        require(
            _msgSender() != operator,
            "ERC1155: setting approval status for self"
        );
        LibSubscriptions.SubscriptionStorage storage ss =
            LibSubscriptions.subscriptionStorage();
        ss._operatorApprovals[_msgSender()][operator] = approved;
        emit ApprovalForAll(_msgSender(), operator, approved);
    }

    function isApprovedForAll(address account, address operator)
        public
        view
        override
        returns (bool)
    {
        LibSubscriptions.SubscriptionStorage storage ss =
            LibSubscriptions.subscriptionStorage();
        return ss._operatorApprovals[account][operator];
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 id,
        uint256 amount,
        bytes calldata data
    ) external override {
        require(to != address(0), "ERC1155: transfer to the zero address");
        require(
            from == _msgSender() || isApprovedForAll(from, _msgSender()),
            "ERC1155: caller is not owner nor approved"
        );
        LibSubscriptions.SubscriptionStorage storage ss =
            LibSubscriptions.subscriptionStorage();

        address operator = _msgSender();

        // _beforeTokenTransfer(
        //     operator,
        //     from,
        //     to,
        //     _asSingletonArray(id),
        //     _asSingletonArray(amount),
        //     data
        // );

        ss._balances[id][from] = ss._balances[id][from].sub(
            amount,
            "ERC1155: insufficient balance for transfer"
        );

        ss._balances[id][to] = ss._balances[id][to].add(amount);

        emit TransferSingle(operator, from, to, id, amount);

        LibERC1155.onERC1155Received(operator, from, to, id, amount, data);
    }

    function safeBatchTransferFrom(
        address from,
        address to,
        uint256[] calldata ids,
        uint256[] calldata amounts,
        bytes calldata data
    ) external override {
        require(
            ids.length == amounts.length,
            "ERC1155: ids and amounts length mismatch"
        );
        require(to != address(0), "ERC1155: transfer to the zero address");
        require(
            from == _msgSender() || isApprovedForAll(from, _msgSender()),
            "ERC1155: transfer caller is not owner nor approved"
        );

        LibSubscriptions.SubscriptionStorage storage ss =
            LibSubscriptions.subscriptionStorage();

        // _beforeTokenTransfer(operator, from, to, ids, amounts, data);

        for (uint256 i = 0; i < ids.length; ++i) {
            uint256 id = ids[i];

            ss._balances[id][from] = ss._balances[id][from].sub(
                amounts[i],
                "ERC1155: insufficient balance for transfer"
            );
            ss._balances[id][to] = ss._balances[id][to].add(amounts[i]);
        }

        emit TransferBatch(_msgSender(), from, to, ids, amounts);

        LibERC1155.onERC1155BatchReceived(
            _msgSender(),
            from,
            to,
            ids,
            amounts,
            data
        );
    }

    // Minting
    function mintSubscription(
        address creator,
        uint256 amount,
        address paymentToken,
        uint256 paymentValue,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public {
        verifyAndInc(creator, v, r, s);

        LibSubscriptions.SubscriptionStorage storage ss =
            LibSubscriptions.subscriptionStorage();

        if (amount == 0) {
            amount = uint256(-1);
        }

        uint256 id = (ss.tokenNonce << 128);

        ss.baseToken[id] = LibSubscriptions.BaseToken(
            creator,
            paymentToken,
            paymentValue,
            1
        );

        ss.tokenNonce = ss.tokenNonce.add(1);

        _mint(creator, id, amount, "");
    }

    /***********************************|
   |          Internal Functions        |
   |__________________________________*/

    function _mint(
        address account,
        uint256 id,
        uint256 amount,
        bytes memory data
    ) internal {
        require(account != address(0), "ERC1155: mint to the zero address");

        address operator = _msgSender();

        //  _beforeTokenTransfer(operator, address(0), to, ids, amounts, data); // Unused Hook
    }

    function verifyAndInc(
        address creator,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) internal {
        LibUsers.UserStorage storage us = LibUsers.userStorage();
        LibDiamond.verifySignature(
            creator,
            us.userProps[creator].nonce,
            "mint",
            v,
            r,
            s
        );
        LibUsers.incUserNonce(creator);
    }
}

